import React from "react"

const NasaImg = () => {

    const {nasa} = 'https://pbs.twimg.com/profile_images/1074223648/nasalogo_twitter_400x400.jpg';

    return(
        <div className = "nasa-img">
        {/* <img src='https://pbs.twimg.com/profile_images/1074223648/nasalogo_twitter_400x400.jpg'>  </img> */}
        <img src={nasa} alt="nasa img"> img </img>
        </div>
    );
}

export default NasaImg;
